// SPDX-License-Identifier: Unlicensed

pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "./lib/SafeMath.sol";
import "./lib/Strings.sol";

contract BNBHCharacterV2 is Initializable, AccessControlUpgradeable, ERC721EnumerableUpgradeable, ERC721URIStorageUpgradeable {
    using Strings for uint256;
    using SafeMath for uint256;
    //using HeroLibrary for HeroLibrary.Hero;
    //using HeroLibrary for HeroLibrary.Town;
    bytes32 public constant GAME_ADMIN = keccak256("GAME_ADMIN1111111111111111111111");
    bytes32 public constant NO_OWNED_LIMIT = keccak256("NO_OWNED_LIMIT");    


    string private baseURI;

    function initialize () public initializer {
        __ERC721_init("BNBHCharacter", "BHC");
        __AccessControl_init_unchained();

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    modifier onlyOwner() {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Not admin");
        _;
    }

    modifier onlyOwnerOf(address account, uint256 _heroId) {
        require(ownerOf(_heroId) == account, "Must be owner of hero to battle");
        _;
    }

    modifier restricted() {
        _restricted();
        _;
    }

    function _restricted() internal view {
        require(hasRole(GAME_ADMIN, msg.sender) == true, "Does not have role");
    }
    function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize) internal override(ERC721Upgradeable, ERC721EnumerableUpgradeable) {
        
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function mint() external restricted returns(uint256) {
        uint256 id = totalSupply();
        _safeMint(msg.sender, id + 1);
        return id;
    }
    function _burn(uint256 tokenId) internal override(ERC721Upgradeable, ERC721URIStorageUpgradeable) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721Upgradeable, ERC721URIStorageUpgradeable)
        returns (string memory)
    {
        require(_exists(tokenId), "Cannot query non-existent token");
        
        return string(abi.encodePacked(_baseURI(), tokenId.toString()));
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721Upgradeable, ERC721EnumerableUpgradeable, AccessControlUpgradeable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function setBaseURI(string memory uri) public onlyOwner {
        baseURI = uri;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function isContract(address account) internal view returns (bool) {
        // This method relies on extcodesize, which returns 0 for contracts in
        // construction, since the code is only stored at the end of the
        // constructor execution.

        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }

}
